const Index = () => (
  <div>
    <div className = "centered">
      <h2>harsimus</h2>
    </div>

    <style>
      {`
        html {
          position: relative;
          background-color: #000000;
        }

        body {
          margin: 0px !important;
          font-family: Helvetica, Arial, Sans-Serif;
          font-weight: bold;
          color: #FFFFFF;
        }

        .centered {
          position: fixed;
          top: 50%;
          left: 50%;
          /* bring your own prefixes */
          transform: translate(-50%, -50%);
        }
      `}
    </style>
  </div>
);

export default Index;
